  productId=props.location.pid.myval;
  return (
    <div className="vrEx">
 <a-scene>
  <a-entity gltf-model="Images/BasketBall.glb" scale="0.2 0.2 0.2"  position="2 1 -10" >
     </a-entity>
    </a-scene> 
    </div>
    );
}


export default VREx;
